import React from 'react';
import { withStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import Menu from '@material-ui/core/Menu';
import MenuItem from '@material-ui/core/MenuItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import InboxIcon from '@material-ui/icons/MoveToInbox';
import DraftsIcon from '@material-ui/icons/Drafts';
import SendIcon from '@material-ui/icons/Send';

const StyledMenu = withStyles({
  paper: {
    border: '1px solid #d3d4d5',
  },
})((props) => (
  <Menu
    elevation={0}
    getContentAnchorEl={null}
    anchorOrigin={{
      vertical: 'bottom',
      horizontal: 'center',
    }}
    transformOrigin={{
      vertical: 'top',
      horizontal: 'center',
    }}
    {...props}
  />
));

const StyledMenuItem = withStyles((theme) => ({
  root: {
    '&:focus': {
      backgroundColor: theme.palette.secondary.main,
      '& .MuiListItemIcon-root, & .MuiListItemText-primary': {
        color: theme.palette.common.white,
      },
    },
  },
}))(MenuItem);

const CustomizedMenus=()=> {
  const [anchorEl, setAnchorEl] = React.useState(null);

  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };

  return (
   <>
      <Button
        aria-controls="customized-menu"
        aria-haspopup="true"
        variant="contained"
        color="secondary"
        
        onClick={handleClick}
      >
        Categories
      </Button>
      <StyledMenu
        id="customized-menu"
        anchorEl={anchorEl}
        keepMounted
        open={Boolean(anchorEl)}
        onClose={handleClose}
      >
        <StyledMenuItem>
        {/*   <ListItemIcon>
            <SendIcon fontSize="small" />
          </ListItemIcon> */}
          <ListItemText primary="Watch with your Bae" />
        </StyledMenuItem>
        <StyledMenuItem>
        {/*   <ListItemIcon>
            <DraftsIcon fontSize="small" />
          </ListItemIcon> */}
          <ListItemText primary="Movies like Gladiator" />
        </StyledMenuItem>
        <StyledMenuItem>
         {/*  <ListItemIcon>
            <InboxIcon fontSize="small" />
          </ListItemIcon> */}
          <ListItemText primary="Light mood movies" />
        </StyledMenuItem>
        <StyledMenuItem>
        {/*   <ListItemIcon>
            <SendIcon fontSize="small" />
          </ListItemIcon> */}
          <ListItemText primary="ROFL movies" />
        </StyledMenuItem>
        <StyledMenuItem>
        {/*   <ListItemIcon>
            <SendIcon fontSize="small" />
          </ListItemIcon> */}
          <ListItemText primary="Movies like Interstellar" />
        </StyledMenuItem>
      </StyledMenu>
    </>
  )
} 
export default CustomizedMenus;
